import styled from "styled-components";

const getScreenHeight = () => {
    return window.screen.height;
}

export const ResumeIframe = styled.iframe`
  flex: 1;
  overflow: hidden;
    `;

export const ResumeContainer = styled.div`
    display: flex;
  height: ${getScreenHeight()};
  `;
